    const { status, data: movies } = useQuery("movies", getMovies);

    //console.log(movies)


    return(
        <div>
            <h1>Movies</h1>
            {status === "loading" ? (
            <Spinner>Loading...</Spinner>
            ) : ( 
                <h1>Test</h1>
            )}          
        </div>  
    );
}; 

export default Movies;
